import React from 'react';
import BlurImage from 'react-blur-image';

const BlurredBackground = ({ src, blur }) => {
  return (
    <BlurImage
      src={src}
      blur={blur} // blur in pixels
    />
  );
};

const SearchBar = () => {
  return (
    <div className="search-bar">
      <input type="text" placeholder="Search..." />
      <button type="submit">Search</button>
    </div>
  );
};

const Layout = ({ children }) => {
  return (
    <div>
      <BlurredBackground src="image-url.jpg" blur={10} />
      <SearchBar />
      {children}
    </div>
  );
};

const App = () => {
  return (
    <Layout>
      <h1>My Website</h1>
      <p>This is my website content.</p>
    </Layout>
  );
};

export default App;
